import React from "react";
import { CartDropdown } from "react-bootstrap";

function Navbar() {
  return (
    <ul class="list-group list-group-flush">
      <a href="/Main" class="list-group-item">
        Главная
      </a>
      <a href="/Catalog" class="list-group-item">
        Автомобили
      </a>
      <a href="/Contacts" class="list-group-item">
        Контакты
      </a>
      <a href="/Basket" class="list-group-item">
        Корзина
        <CartDropdown socialDrp={socialDrp} setsocialDrp={setsocialDrp} />
      </a>
    </ul>
  );
}

export default Navbar;
